window.bookSummaryJSON = "<p><b>Powerful and merciless. Cunning and cruel. A monster wrapped in luxury and wealth. Mikhail Romanov is my opposite in every wayâ€¦ and my new husband.</b></p> <p>In exchange for his protection, he'll demand everything from me. My obedience. My submission. My body.</p> <p>But marriage is only the beginning. I'll have his baby, too.</p> <p>I thought I was clever. A penniless hacker hiding from the world. That no one would discover who I am and what I've done.</p> <p>I was so wrong.</p> <p>The solution: Marry the man more powerful than my enemies.</p> <p>While endless wealth and power don't melt his icy glare, the fiery tension between us threatens to combust every second we're near. Every command. Every touch.</p> <p>If I leave, I have nowhere to go. I'm being hunted by his enemies.</p> <p>But if I stay? I'm wedded to a monster who plans to keep me forever.</p> <p>Sovereign <i>is a steamy, forced marriage, dark bratva standalone romance by bestselling author Jane Henry. Featuring a brilliant, altruist heroine, and an ultra-controlling, hyper-vigilant hero with \"look at her and I'll dispatch you\" energy. No cliffhanger. HEA included.</i></p> <p><i>Narrated in duet style.</i></p>"; 
